import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Home from '../src/pages/Home/home';
import Login from '../src/pages/Login/login';

const App = () => {
  return (
    <>
    <Router>
      <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/">
            <Login />
          </Route>
      </Switch>
    </Router>
    </>
  )
}

export default App;
